// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { RoleProvider } from './context/RoleContext';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <RoleProvider>
    <App />
  </RoleProvider>
);
